import "./App.css";
import Producten from './components/Producten'
import {BrowserRouter as Router, Switch, Route, Link} from 'react-router-dom'

function App() {
    return (
        <Router>
            <Switch>
                <Route path="/product" component={Producten} />
            </Switch>
        </Router>
    );
}

export default App;
